import React from 'react'
import teams from '../teams.json'
import DataTable from 'react-data-table-component';

 function JsonDataDisplay(){

    const columns = [
        {
            name: 'League ID',
            selector: row => row.LeagueID,
            sortable:  true,
            wrap: true,
            grow: 1, 
        },
        {
            name: 'Name',
            selector: row => row.Name,
            wrap: true,
            center: true,
            grow: 2, 
        },
        {
            name: 'Oddset Name',
            selector: row => row.OddsetName,
            wrap: true,
            center: true,
            grow: 2, 
        },

        {
            name: 'TV4 Name',
            selector: row => row.TV4Name,
            wrap: true,
            center: true,
            grow: 2, 
        },

    ];

    return(
        <div>
            <DataTable 
            columns={columns}
            data={teams}
            dense

            />

        </div>
    )
 }

 export default JsonDataDisplay;
